import React from "react";
import "./App.css";


const App = () => {
  const APP_KEY = "d9f018ab094f5f7a34df0ec41f79c368";

  const exampleReq = `https://api.openweathermap.org/data/2.5/weather?q=London&units=metric&appid=${APP_KEY}`;
  return (
    <div className="App">
       <form className="search-form">
        <input
          className="search-bar"
          type="text"
        />
        <button className="search-button" type="submit">Search</button>
      </form>
    </div>
  );
};

export default App;
